function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}

        {/* < Test /> */}
        < NotificationForm />
      </header>
      <Router>
            <Routes>
                <Route path="/" element={<NotificationForm />} />
                <Route path="/lists" element={<NotificationList />} />
            </Routes>
        </Router>
    </div>

  );
}

export default App;
